import stock from "./stock";

const LineaStock = () => {
  return (
    <tbody>
      {stock.map((usuario) => {
        <tr>
          <td>
            <input
              class="form-check-input"
              type="radio"
              name="radioNoLabel"
              id="radioNoLabel1"
            />
          </td>

          <td>{usuario.cantidad}</td>

          <td>{usuario.cantidad_minima}</td>

          <td>{usuario.descripcion}</td>

          <td>{usuario.tipo}</td>
        </tr>;
      })}
    </tbody>
  );
};

export default LineaStock;
